import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from './components/common/Header'; // Import Header here
import Footer from './components/common/Footer'; // Make sure this path is correct
import ParkingLotListPage from './components/ParkingLotListPage'; // Ensure this is correct

const App = () => {
  return (
    <Router>
      <Header />
      <Routes>
        {/* Home Route */}
        <Route path="/" element={<Header />} />
        {/* Route for available parking lots */}
        <Route path="/owners" element={<ParkingLotListPage />} />
        {/* Route for energy providers */}
        {/* <Route path="/installers" element={<EnergyProviderListPage />} /> */}
      </Routes>
      <Footer />
    </Router>
  );
};

export default App;
